import React, { useState } from 'react';

// Mock TradingViewChart component
function TradingViewChart({ token }) {
  return (
    <div className="h-72 flex flex-col items-center justify-center">
      <div className="w-full h-48 bg-gradient-to-br from-indigo-900/60 to-black/80 rounded-lg flex items-center justify-center text-white/40 text-2xl font-bold">
        {token ? `Chart: $${token}` : 'No token selected'}
      </div>
      <div className="mt-4 text-white/60 text-sm">[Simulated TradingView Chart]</div>
    </div>
  );
}

// Mock token data
const tokenList = [
  {
    name: 'PAWPAW',
    volumeSpike: 115,
    risk: 'Low',
    meta: 'GambleFi',
    roi: 24.4,
    price: '$0.123',
    cap: '$1.2M',
    strategy: 'Smart Whale + GambleFi',
  },
  {
    name: 'BABY BOB',
    volumeSpike: 134,
    risk: 'Low',
    meta: 'GambleFi',
    roi: 34.1,
    price: '$0.089',
    cap: '$0.8M',
    strategy: 'Volume Spike + Meme',
  },
  {
    name: 'RUGPULL',
    volumeSpike: 210,
    risk: 'High',
    meta: 'Meme',
    roi: -12.5,
    price: '$0.002',
    cap: '$0.1M',
    strategy: 'High Risk + Meme',
  },
];

export default function DashboardTab() {
  const [selectedToken, setSelectedToken] = useState(null);

  return (
    <div className="flex px-12 py-10 bg-black min-h-screen gap-6 text-white font-sans">
      {/* Left – Token Feed */}
      <div className="w-1/4 space-y-4">
        <h2 className="text-xl font-semibold mb-2">Pinged Tokens</h2>
        {tokenList.map((t) => (
          <div
            key={t.name}
            className={`bg-neutral-900 hover:bg-neutral-800 transition-all p-4 rounded-xl cursor-pointer shadow-md border border-white/10
              ${selectedToken?.name === t.name ? 'ring-2 ring-indigo-500 scale-[1.02]' : ''}
            `}
            onClick={() => setSelectedToken(t)}
          >
            <div className="flex justify-between">
              <div className="font-bold">${t.name}</div>
              <span className={`text-xs px-2 py-1 rounded-md ${t.risk === 'High' ? 'bg-red-500/20 text-red-400' : 'bg-green-500/20 text-green-300'}`}>
                {t.risk}
              </span>
            </div>
            <div className="text-xs mt-1 text-white/60">Vol: {t.volumeSpike}%</div>
            <div className="text-xs text-white/60">Meta: {t.meta}</div>
            <div className={`text-right font-semibold mt-1 ${t.roi >= 0 ? 'text-green-400' : 'text-red-400'}`}>
              {t.roi >= 0 ? '+' : ''}{t.roi}%
            </div>
          </div>
        ))}
      </div>

      {/* Center – Live Chart */}
      <div className="w-2/4 bg-neutral-900 rounded-xl p-6 shadow-md border border-white/10 flex flex-col">
        <h2 className="text-center text-lg font-semibold mb-2">Live Chart</h2>
        {selectedToken ? (
          <TradingViewChart token={selectedToken.name} />
        ) : (
          <div className="h-72 flex items-center justify-center text-white/30">Click a token to view chart</div>
        )}
      </div>

      {/* Right – Trade Panel */}
      <div className="w-1/4 bg-neutral-900 rounded-xl p-6 shadow-md border border-white/10">
        <h2 className="text-lg font-semibold mb-4">Trading Terminal</h2>
        {selectedToken ? (
          <>
            <div className="text-white mb-2">Token: ${selectedToken.name}</div>
            <div className="text-sm text-white/60 mb-4">
              Price: {selectedToken.price} | Cap: {selectedToken.cap} | Strategy: {selectedToken.strategy}
            </div>
            <div className="space-y-3">
              <button className="w-full py-2 rounded-md bg-green-600 hover:bg-green-500 transition">Buy Chill</button>
              <button className="w-full py-2 rounded-md bg-red-600 hover:bg-red-500 transition">Sell Fast</button>
            </div>
          </>
        ) : (
          <div className="text-white/40">Select a token to trade</div>
        )}
      </div>
    </div>
  );
}
